import React from "react";
import Form from "./comps/Form";
import Hero from "./comps/Hero";
import Navbar from "./comps/NavBar";
import {
  BrowserRouter ,
  Switch,
  Route,
  useParams,Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter >
    <Link to="/today"/> 
    <Link to="/tomorrow"/> 
    </BrowserRouter>  

      <Hero />
      <Form />
    </div>
  );
}

export default App;
